<script setup lang="ts">
import {nextTick, onMounted, reactive, ref} from 'vue'
import Aside from "@/components/Aside.vue";
import Card from "@/components/Card.vue";
import threeHome from '../config/three-example/home.json';
import threeApplicationScene from '../config/three-example/application-scen.json';
import cesiumHome from '../config/cesium-example/home.json';
import cesiumApplicationScene from '../config/cesium-example/application-scen.json';

const config:any=reactive({
  home:[],
  applicationScene:[],
})
// 在现有代码基础上添加以下内容
const mainContainerRef = ref<HTMLElement>()
const sectionRefs = ref<Record<string, HTMLElement>>({})
const activeIndex2 = ref('THREE')
const handleSelect = (key: string, keyPath: string[]) => {
  if(key=='THREE'){
    config.home=threeHome;
    config.applicationScene=threeApplicationScene;
    scrollToSection('home')
  }else if(key=='CESIUM'){
    config.home=cesiumHome;
    config.applicationScene=cesiumApplicationScene;
    scrollToSection('home')
  }
}
// 滚动到指定区块的方法
const scrollToSection = (sectionName: string) => {
  debugger
  console.log(sectionName);
  nextTick(() => {
    const container = mainContainerRef.value
    const target = sectionRefs.value[sectionName]

    if (container && target) {
      // 计算相对位置
      const top = target.offsetTop - container.offsetTop-20;

      // 使用平滑滚动
      container.scrollTo({
        top,
        behavior: 'smooth'
      })
    }
  })
}
const goFmc=()=>{
  window.open('https://gitee.com/fu-meichuan','_blank')
}
onMounted(()=>{
  config.home=threeHome;
  config.applicationScene=threeApplicationScene;
})
</script>

